import React, { useEffect, useState, useContext } from 'react';
import '../../Style.css';
import { Box, Typography, Button, Modal, TextField, IconButton } from '@mui/material';
import axios from 'axios';
import { AuthContext } from '../../context/AuthContext';
import SearchIcon from '@mui/icons-material/Search';
import { styled } from '@mui/material/styles';
import CloseIcon from '@mui/icons-material/Close';

const AddButton = styled(Button)({
    borderRadius: 3,
    padding: '21px 20px',
    boxShadow: 'none',
    textTransform: 'none',
    fontSize: 16,
    backgroundColor: '#0f72bd',
    paddingLeft: '50px',
    paddingRight: '50px',
    lineHeight: 1.5,
    borderColor: '#0f72bd',
    color: '#ffffff',
    fontFamily: [
      '-apple-system',
      'BlinkMacSystemFont',
      '"Segoe UI"',
      'Roboto',
      '"Helvetica Neue"',
      'Arial',
      'sans-serif',
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"',
    ].join(','),
    '&:hover': {
      backgroundColor: '#004f8a',
      borderColor: '#004f8a',
      boxShadow: 'none',
    },
    '&:active': {
      boxShadow: 'none',
      backgroundColor: '#0f72bd',
      borderColor: '#0f72bd',
    },
    '&:focus': {
      boxShadow: '0 0 0 0.2rem rgba(0,123,255,.5)',
    },
});
const CancelButton = styled(Button)({
    borderRadius: 3,
    padding: '21px 20px',
    boxShadow: 'none',
    textTransform: 'none',
    fontSize: 16,
    paddingLeft: '50px',
    backgroundColor: '#ededed',
    paddingRight: '50px',
    lineHeight: 1.5,
    borderColor: '#0f72bd',
    color: '#505e71',
    fontFamily: [
        '-apple-system',
        'BlinkMacSystemFont',
        '"Segoe UI"',
        'Roboto',
        '"Helvetica Neue"',
        'Arial',
        'sans-serif',
        '"Apple Color Emoji"',
        '"Segoe UI Emoji"',
        '"Segoe UI Symbol"',
    ].join(','),
    '&:hover': {
        backgroundColor: '#e0e0e0',
        borderColor: '#e0e0e0',
        boxShadow: 'none',
    },
    '&:active': {
        boxShadow: 'none',
        backgroundColor: '#e0e0e0',
        borderColor: '#e0e0e0',
    },
    '&:focus': {
        boxShadow: '0 0 0 0.2rem rgba(0,123,255,.5)',
    },
});
const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: '100%',
  height: '100%',
  backgroundColor: 'white',
};

function MobileCrane() {
  const [craneAssets, setCraneAssets] = useState([]);
  const {userToken} = useContext(AuthContext);

  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  useEffect(() => {
    console.log(userToken);
    const headers = {
      'Content-Type': 'application/json',
      'Authorization': `Bearer ${userToken}`,
    };
    try {
      axios.get('http://127.0.0.1:8000/api/assets/mcrane', {
        headers: headers
      })
      .then((res) => {
        setCraneAssets(res.data.data);
      })
    } catch(e) {
      console.log(e);
    }
  })

  return (
    <>
      <Box sx={{
          position: 'relative', 
          width: 415,
          maxWidth: 415,
          paddingBottom: '100px',
          boxShadow: '3px 3px 7px rgba(103, 162, 206, 0.2)', 
          zIndex: 5,
        }}
      >
        <Box display="flex" sx={{
          height: '75px',
          borderBottom: 2,
          borderColor: '#edf2f6',
          alignItems: 'center',
          justifyContent: 'center',
        }}>
          <Box borderRight={2} borderColor='#e0e0e0' sx={{display: 'flex', width:100, height:75, alignItems: 'center', justifyContent: 'center'}}>
            <Button sx={{flexDirection: 'column'}}>
                <Box border={2} borderColor='#9cb1cd' sx={{width: '20px', marginBottom: '2px', borderRadius: 1}}/>
                <Box border={2} borderColor='#9cb1cd' sx={{width: '10px', marginBottom: '2px', borderRadius: 1}}/>
                <Box border={2} borderColor='#9cb1cd' sx={{width: '5px', borderRadius: 1}}/>
            </Button>
          </Box>
          <TextField
            sx={{width: '100%', margin: '0 5px'}}
            placeholder='Search Mobile Cranes...'
            InputProps={{
                endAdornment: (
                  <SearchIcon/>
                ),
            }}
            />
        </Box>
        <Box display="flex" sx={{
          height: 'calc(100% - 65)',
        }}>
          <Box sx={{
            display: 'flex',
          }}>
            <Box sx={{flexDirection: 'column', width: 415}}>
              {
                craneAssets.map((craneAssets) => (
                  <Box display="flex" alignItems="center" justifyContent="space-between" sx={{minHeight: 100, padding: '0px 45px', borderBottom: 2, borderBottomColor: '#edf2f6'}}>
                    <h1>{craneAssets.custom_name}</h1>
                  </Box>
                ))
              }
            </Box>
            <Box display="flex" justifyContent="center" alignItems="center" sx={{position: 'fixed', bottom: 0, height: 100, width: 415, padding: '15px 20px', borderTop: 2, borderTopColor: '#edf2f6'}}>
                <AddButton sx={{width: '100%', height: '100%'}} onClick={() => handleOpen()}>Add Mobile Crane</AddButton>
            </Box>
          </Box>
        </Box>
      </Box>
      <Modal
        open={open}
      >
        <Box sx={style}>
          <Box borderBottom={2} borderColor='#e0e0e0' sx={{display: 'flex', width: '100%', height: '75px', justifyContent: 'flex-end', padding: '10px'}}>
            <IconButton onClick={() => handleClose()}>
              <CloseIcon/>
            </IconButton>
          </Box>
          <Box sx={{display: 'flex', margin: '50px 20px', alignItems: 'center', flexDirection: 'column'}}>
              <Typography>Add Mobile Crane</Typography>
              <Box>
                <Typography>Name</Typography>
                <TextField sx={{width: '360px'}}/>
              </Box>
              <Box>
                <Typography>Crane Manufacturer</Typography>
                <TextField sx={{width: '360px'}}/>
              </Box>
              <Box>
                <Typography>Model</Typography>
                <TextField sx={{width: '360px'}}/>
              </Box>
              <Box sx={{display: 'flex', marginTop: '50px', flexDirection: 'column'}}>
                <Box sx={{marginTop: '10px'}}>
                  <AddButton sx={{width: '360px', height: '75px'}}>Add</AddButton>
                </Box>
                <Box sx={{marginTop: '10px'}}>
                  <CancelButton sx={{width: '360px', height: '75px'}} onClick={() => handleClose()}>Cancel</CancelButton>
                </Box>
              </Box>
          </Box>
        </Box>
      </Modal>
    </>
  );
}

export default MobileCrane;
